import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import Landing from './components/Landing/index'

function App() {
  return (
   <Router>
     <Switch>
       <Route exact component={Landing} />
     </Switch>
   </Router>
  );
}

export default App;
